import React from 'react';
import Product from './subpages/Product';

const ProductPage = () => {

    const products = [
        {
            image: "https://example.com/teddy-bear.jpg",
            name: 'Cute Soft Teddybear',
            price: "285",
            oldPrice: "345",
            rating: "3"
        },
        {
            image: "https://example.com/teddy-bear.jpg",
            name: 'Cute Soft Teddybear',
            price: "285",
            oldPrice: "345",
            rating: "3"
        },
        {
            image: "https://example.com/teddy-bear.jpg",
            name: 'Cute Soft Teddybear',
            price: "285",
            oldPrice: "345",
            rating: "3"
        },
    ];

    return (
        <div className="product-page">
            <h2>Our Products</h2>
            <div className="products-list">
                {products.map((product) => (
                    <Product key={product.id} product={product} />
                ))}
            </div>
        </div>
    );
};

export default ProductPage;
